logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1978,logseq____&quot;^Flogseq____&quot;,1977,536870974]],[logseq____&quot;^15logseq____&quot;,[1978,logseq____&quot;^Xlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1978,logseq____&quot;^Vlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1978,logseq____&quot;^Ulogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1978,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u673c0a4f-9900-43a5-9437-89a4571fb04dlogseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Flogseq____&quot;,1978,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Xlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Vlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Ulogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Ulogseq____&quot;,1976,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^Hlogseq____&quot;,1976,536870974]],[logseq____&quot;^15logseq____&quot;,[1979,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u673c0a4f-eab4-46cd-b5c8-4c94c73de459logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1980,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. ’It’s slow and steady and it grows. I think the beauty lies in the simplicity of it.”logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1980,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1980,logseq____&quot;^Flogseq____&quot;,1979,536870974]],[logseq____&quot;^15logseq____&quot;,[1980,logseq____&quot;^Xlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1980,logseq____&quot;^Vlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1980,logseq____&quot;^Ulogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1980,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u673c0a4f-6ac0-45d9-821f-ba216858d2f0logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1981,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Club music will always be at the core of Yotto’s work, but his ambient catalogue will no longer sit in the shadows. Together, these parallel forms of expression don’t dilute Yotto’s artistry; they make it even stronger.logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1981,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1981,logseq____&quot;^Flogseq____&quot;,1980,536870974]],[logseq____&quot;^15logseq____&quot;,[1981,logseq____&quot;^Xlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1981,logseq____&quot;^Vlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1981,logseq____&quot;^Ulogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1981,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u673c0a4f-81ea-428e-b303-83fb21b43c25logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1982,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1982,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1982,logseq____&quot;^Flogseq____&quot;,1981,536870974]],[logseq____&quot;^15logseq____&quot;,[1982,logseq____&quot;^Xlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1982,logseq____&quot;^Vlogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1982,logseq____&quot;^Ulogseq____&quot;,180,536870974]],[logseq____&quot;^15logseq____&quot;,[1982,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u673c0a4f-b4e1-482f-8aab-5055e523f9f1logseq____&quot;,536870974]],[logseq____&quot;^15logseq____&quot;,[1984,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;![Screenshot 2024-11-18 at 7.21.23 PM.png](../assets/Screenshot_2024-11-18_at_7.21.23_PM_1731986523100_0.png)logseq____&quot;,536870975]],[logseq____&quot;^15logseq____&quot;,[1984,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,53687097
